import {View, StyleSheet } from 'react-native'
import ThemedText from './ThemedText';

const style = StyleSheet.create({
	panel: {
		display: 'flex',
		flexDirection: 'row',
		paddingTop: 20
	},
	pair: {
		paddingHorizontal: 10,
		textAlign: 'center' 
	}
})

const InfoPair = ({ top, bottom }) => (
	<View style={style.pair}>
		<ThemedText 
			fontWeight='bold' 
			fontSize='subheading'
			withPadding
		>
			{top}
		</ThemedText>
		<ThemedText>
			{bottom}
		</ThemedText>
	</View>
)

const PanelBottom = ( { stars, forks, reviews, rating }) => {
	return (
		<View style={style.panel}>
			<InfoPair top={stars} bottom='Stars' />
			<InfoPair top={forks} bottom='Forks' />
			<InfoPair top={reviews} bottom='Reviews' />
			<InfoPair top={rating} bottom='Rating' />
		</View>
	)
} 

export default PanelBottom
